style.css:
@-moz-document domain("electronjs.org") {
body {
    background-color: #111111;
    color: #bababa;
}

h1 {
    color: #bebebe;
}

code {
    color: #6565ce;
}

.hljs {
    color: #c1c1c1;
}

.subtron, .footer {
    background-color: #252525!important;
    border: none;
}

.docs-version {
    background-color: #3a2d3e;
    border: 1px solid #483145;
    color: #e7d3e7;
}

.docs-breadcrumbs a, a.footer-nav-item {
    color: #88aacc!important;
}

.PRIMER-REMOVE-ME .markdown-body pre {
    background-color: #2b2b2b;
}

.hljs-comment {
    color: #888888;
}

.hljs-keyword, .hljs-selector-tag, .hljs-subst {
    color: #dfdfdf;
}

.hljs.language-html .hljs-tag, .hljs.language-html .hljs-name {
    color: #8411ef;
}

.hljs-string {
    color: #c70830;
}

.btn-group.border {
    border: 3px solid #121212!important;
}

pre .btn-clipboard {
    background-color: #121212!important;
    color: #c8c8c8;
    font-weight: bold;
}

pre .btn-clipboard:hover {
    background-color: #222222!important;
    color: #d7d7d7;
}

}
